factorTypes:
  - _id: EMFiKE9FxL6cX7Ez8
    name: playerCount
    description: The Number of players participating in the given game.
    required: true
    type: Integer
    min: 1
  - _id: BxJpCk9cevNnudWBB
    name: basePay
    description: >-
      The base amount of money (in USD) a user will get for completing the
      experiment
    required: false
    type: Number
    min: 0
    max: 99999
  - _id: xusRHAyx8EEBmir9Q
    name: conversionRate
    description: >-
      The conversion rate of score to bonus dollars paid: points x
      conversionRate = bonus in USD
    required: false
    type: Number
    min: 0
    max: 99999
  - _id: bkF6kYmxwzAfyncq3
    name: networkStructure
    description: >-
      For multiplayer, determines who is connected to who in terms of 1-1 chats.
      For example, “1-2, 1-3, 2-3” means that player 1 can talk to player 2 and
      3, player 2 can talk to player 1 and 3, and player 3 can talk to player 1
      and 2.
    required: true
    type: String
    min: 0
    max: 9999
  - _id: PRDoNLNam38iHtyzz
    name: numRounds
    description: number of rounds that will be played by players
    required: false
    type: Integer
    min: 1
    max: 20
    archivedAt: 2022-04-11T19:55:19.676Z
  - _id: q3mtZL9RRau8pu6Sk
    name: setSize
    description: The number of symbols a player sees in each task
    required: true
    type: Number
    min: 1
    max: 999
    archivedAt: 2022-04-15T14:13:51.939Z
  - _id: AvSzfEvM76qzFrB8g
    name: skipIntro
    description: 'For debugging purposes: skips over the tutorial and initial quiz'
    required: false
    type: Boolean
  - _id: 8fM3xysHDXN2kYgSq
    name: setSizeBasedOnPlayerCount
    description: >-
      Setting this to true will result in the symbol set size to be playerCount
      + 1. If false, symbol set size will be based on a default value
    required: true
    type: Boolean
  - _id: X8jdzeWyu2bao9rwj
    name: userInactivityDuration
    description: >-
      Duration of time (seconds) until a player gets kicked out of game due to
      inactivity (Not messaging, submitting, clicking on anything)
    required: true
    type: Number
    min: 0
    max: 99999
  - _id: zeay2JbmRBg99NvnA
    name: numTaskRounds
    description: Number of task rounds in a game
    required: true
    type: Integer
    min: 0
    max: 99999
  - _id: aJm4nPNsCGuZieGFX
    name: numSurveyRounds
    description: >-
      Number of survey rounds in the game (Surveys rounds will be placed in even
      intervals within the total number of task rounds)
    required: true
    type: Integer
    min: 0
    max: 99999
  - _id: wEsdcXWYJA2acghXg
    name: taskDuration
    description: Duration (in seconds) players get to complete a task round
    required: true
    type: Integer
    min: 0
    max: 999999
  - _id: rxhc7t7AFwiG7KPM6
    name: surveyDuration
    description: Duration (in seconds) players get to complete a survey round
    required: true
    type: Integer
    min: 0
    max: 999999
  - _id: EraBq7JRamAjzMMZY
    name: resultsDuration
    description: >-
      Duration (in seconds) players get to see the results following a task
      round
    required: true
    type: Integer
    min: 0
    max: 999999
  - _id: zXqf74Ry9RC9TxLcR
    name: defaultSetSize
    description: 'If setSizeBasedOnPlayerCount is false, the defaultSetSize will be used'
    required: true
    type: Integer
    min: 0
    max: 999
  - _id: yg3T7jELpr2qFEZYa
    name: idleWarningTime
    description: >-
      Users will be shown a warning idleWarningTime (seconds) before the
      userInactivityDuration. (i.e. 60 s means players will be shown a warning
      if they have been idle for (userInactivityDuration - 60) s )
    required: true
    type: Integer
    min: 0
    max: 999999
  - _id: CFbrZPGEBjvoXPYt4
    name: toggleInactiveTimer
    description: >-
      If true, turn on inactive timer/warnings; If false, turn off inactive
      timer/warnings
    required: true
    type: Boolean
    archivedAt: 2022-04-15T15:08:04.033Z
  - _id: Qm4JPdnxfQE59QgZo
    name: endGameIfPlayerIdle
    description: >-
      If this is true, if a player becomes inactive at any point in the game,
      the whole game will end. Otherwise, the players will default to a fully
      connected layer
    required: true
    type: Boolean
  - _id: yxtKFHYTZ7Bj7oSCq
    name: maxNumOverlap
    description: Maximum number of symbols that overlap with n-1 players.
    required: true
    type: Integer
    min: 0
    max: 99999
  - _id: zR7ehSLAoaBd7BGHa
    name: maxGameTime
    description: >-
      Maximum time (in minutes) allotted for participants to play the game
      before they are sent to the Exit Survey
    required: false
    type: Number
    min: 0
    max: 99999
  - _id: wbr7mLvcfLzB6QRaw
    name: taskWarningTime
    description: >-
      Users will be shown a warning taskWarningTime (seconds) before the
      taskDuration duration. (i.e. 60 means players will be shown a warning if
      there is 60 seconds left to complete the task)
    required: false
    type: Number
    min: 0
    max: 99999
  - _id: 7wbct5KE4jMw5qMdt
    name: minPlayerCount
    description: >-
      The minimum number of players that a game should have. If there are less
      players than the minPlayerCount, the game will end.
    required: false
    type: Integer
    min: 0
    max: 9999
  - _id: KWoWFwwx7Q6pkgfeq
    name: isPreQualification
    description: 'True if  game is pre-qualification, false otherwise'
    required: false
    type: Boolean
